import { useState } from "react";
import ReactExport from "react-export-excel";

import "./App.css";
import ExcelSheets from "./ExcelSheets";

const ExcelFile = ReactExport.ExcelFile;
const ExcelSheet = ReactExport.ExcelFile.ExcelSheet;
const ExcelColumn = ReactExport.ExcelFile.ExcelColumn;

function App() {
  const [data, setData] = useState({});
  const [phone, setPhone] = useState();

  const dataExcel = () => {
    return data?.result?.map((phone, index) => {
      return {
        id: index,
        phone: phone,
      };
    });
  };

  const handleChange = (event) => {
    setPhone(event.target.value);
  };

  const onSubmit = (e) => {
    e.preventDefault();
    fetch(`http://localhost:80/randomphonenumbers/?phone=${phone}`)
      .then((res) => res.json())
      .then((record) => setData(record));
  };

  const renderTableData = () => {
    return data?.result?.map((phone, index) => {
      return (
        <tr key={index}>
          <td>{phone}</td>
        </tr>
      );
    });
  };

  const dataRender = dataExcel();
  console.log(dataRender);
  return (
    <div className="App">
      <header className="App-header">
        <h1>Filtro para buscar telefonos</h1>
        <form onSubmit={onSubmit}>
          <label>Telefono: </label>
          <input type="number" onChange={handleChange} />
          <input type="submit" />
        </form>
        {/* <ExcelFile element={<button>Descargar</button>} fileName="Telefonos">
          <ExcelSheet data={dataRender} name="Numero telefonicos" />
          <ExcelColumn label="ID" value="id" />
          <ExcelColumn label="telefonos" value="phone" />
        </ExcelFile> */}
        <ExcelSheets />
        <table id="phones">
          <thead>
            <tr>
              <th>Phone Number</th>
            </tr>
          </thead>
          <tbody>{renderTableData()}</tbody>
        </table>
      </header>
    </div>
  );
}

export default App;
